INSERT INTO `itens` VALUES (1,'','R$ 2.899,99','\nAsus MD15 um dos menores notebooks de 15 polegadas do mundo\nSeja para trabalho ou lazer, o ASUS M515  um notebook que oferece desempenho poderoso e visuais envolventes. Sua tela NanoEdge possui um revestimento antirreflexo fosco para uma experincia verdadeiramente envolvente. O M515  equipado com at processador AMD Ryzen e memria de 8 GB. Armazenamento rpido com SSD com at 256GB PCIe SSD.\n\nMais velocidade no seu dia a dia\nO ASUS M515 possui armazenamento SSD, que alm de ser muito mais rpido que o HD convencional,  menor, mais leve e no tem partes mecnicas extremamente sensveis a impactos e solavancos. Isso garante maior proteo aos dados armazenados no seu notebook, para que voc possa trabalhar sem preocupaes, com alto desempenho e produtividade, mesmo em um veculo em movimento.\n\nRpido e eficiente\nCom processadores at SrioAMD Ryzen com 8 GB de memria, o ASUS M515 ajuda voc a fazer as coisas com rapidez e eficincia.\n\nTenha uma viso mais ampla do mundo\nA tela NanoEdge d ao ASUS M515 uma vasta rea de tela para uma experincia de visualizao envolvente seja para o trabalho ou lazer. Com tela FHD de viso ampla apresenta um revestimento antirreflexo para reduzir distraes indesejadas de reflexos irritantes, para que voc possa realmente se concentrar no que est  sua frente.\n','Notebook Asus AMD Ryzen 5-3500U, 8GB RAM, SSD 256GB, 15,6\', Radeon Vega 8, Windows 11 Home, Cinza - M515DA-BR1213W',2,1),(2,'','R$ 1.999,00','\n\nSmartphone Samsung Galaxy S20 FE 5G 128GB\n \nEste  o smartphone para pessoas que querem tudo. Ouvimos vocs, os fs, e agora no precisam mais ficar em dvida sobre o que escolher. Este  o smartphone feito sob medida para fs de todos os tipos. Ento, se voc  f de fotografia, jogos ou adora deixar seu feed repleto de tudo que o inspira, ns reunimos a combinao definitiva de inovao S20. Este  o smartphone que oferece o que voc deseja, para voc fazer mais daquilo que ama.\n\nA Cmera de Lente Tripla de Nvel Profissional\nA cmera de lente tripla de nvel profissional permite que voc tire aquela foto profissional digna de #semfiltro com facilidade. Enquadre a cena com a cmera wide e, a seguir, mostre ainda mais com a cmera ultra-wide, ou aumente o zoom com o zoom ptico de 3x na cmera teleobjetiva.\n\nConectividade\nO LTE de at 1,6 Gbps oferece velocidades de dados poderosas, enquanto o Wi-Fi 6 conecta voc com segurana e baixa latncia, mesmo em um local lotado. Portanto, quer voc esteja conectado a LTE ou Wi-Fi, pode jogar em tempo real com pouco atraso.\n\nBateria Inteligente o Dia Todo para que Voc possa Jogar por Horas\nViva sua vida sem se preocupar com onde voc pode conectar seu smartphone. A bateria de 4500mAh (padro) d ao seu smartphone a energia necessria para durar mais que o seu dia, e  inteligente o suficiente para economizar energia para quando voc realmente precisar.\n \nEspao para Milhares de Fotos e Vdeos\nCom 128 GB integrados e a capacidade de armazenar at 1 TB (no incluso) a mais em um carto microSD, o nico limite para o que voc pode armazenar  o que voc pode criar e baixar.\n\n','Smartphone Samsung Galaxy S20 FE 5G, 6GB RAM, Snapdragon 865, 128GB, Octa Core, Cmera Tripla 32MP, Tela Infinita 6.5, Azul Marinho - SM-G781BZBRZTO',3,1),(3,'','R$ 1.299,99','A TGC12 ThunderX3  uma cadeira gamer com revestimento de Poliuretano (PU) coberta com costuras de fibra de carbono. Seu estofado  em forma de diamantes construda com firmeza para proporcionar conforto enquanto voc desfruta do prazer de jogar seus games favoritos. Da sala de estar para a sala de jogos, voc pode planejar a prxima dominao do mundo do conforto de sua cadeira gamer.','Cadeira Gamer ThunderX3 TGC12, Black',5,1),(4,'','R$ 4.499,90','\nConsole Sony Playstation 5\n \nJogar no PS5 No Tem Limites\nDesfrute do carregamento do seu PS5, extremamente rpido com o SSD de altssima velocidade, uma imerso mais profunda com suporte a feedback ttil, gatilhos adaptveis e udio 3D, alm de uma gerao indita de jogos incrveis para PlayStation.\n\nVeloz como um raio, SSD ultrarrpido\nDomine o poder de uma CPU e GPU personalizadas e o SSD com E/S integradas que redefinem as regras do que o console PlayStation pode fazer.\n\nMaximize suas sesses de jogo com tempo de carregamento praticamente instantneo para jogos do PS5 instalados.\n\nJogos impressionantes para PS5\nMaravilhe-se com os grficos incrveis e experimente os recursos do novo PS5. \'Ray Tracing\' (Rastreamento de raios) Mergulhe em mundos com um nvel indito de realismo enquanto os raios de luz so simulados individualmente, criando sombras e reflexos realistas em jogos compatveis com Playstation 5. Jogos para TVs 4K Curta seus jogos favoritos do PS5 na sua incrvel TV 4K. At 120 fps com sada em 120 Hz Desfrute da fluidez e taxa de quadros de at 120 fps em jogos compatveis, com suporte a sada de 120 Hz em telas 4K.\n\nTecnologia HDR\nCom uma TV HDR, os jogos compatveis do PS5 exibem uma variedade de cores inacreditavelmente vibrantes e realistas. Sada em 8K Os consoles PS5 oferecem suporte  sada 8K, para que voc possa jogar na sua tela com resoluo de 4320p.\n\nTempest 3D AudioTech\nMergulhe em palcos sonoros que faro voc acreditar que os sons esto vindo de todas as direes. Seja com seus fones de ouvido ou os alto-falantes de sua TV, seu ambiente ganhar vida com o Tempest 3D AudioTech em jogos compatveis.\n\nResposta ttil\nExperimente a resposta ttil com o controle sem fio DualSense em jogos selecionados do PS5 e sinta o impacto de suas aes no jogo atravs da resposta sensorial dinmica.\n\nGatilhos adaptveis\nAssuma o controle com os imersivos gatilhos adaptveis, agora com nveis dinmicos de resistncia que simulam o impacto fsico das atividades em jogos selecionados do PS5.\n\n','Console Sony Playstation 5',4,1),(5,'','R$ 179,99','\nHeadset Gamer HyperX Cloud Stinger\n \nFaa parte da famlia Cloud da HyperX com o headset Cloud Stinger!\nCompleta e verstil, a linha de headsets Cloud foi projetada para as necessidades de qualquer nvel de jogador. Independente do seu sistema, estilo de jogo e caractersticas este headset ir te surpreender. O Cloud Stinger  um modelo licenciado oficialmente pela Xbox, perfeito para jogadores de Xbox One! Conforto, tecnologia e design a sua altura.\n\nHyperX confortvel para todo tipo de rosto\nOs fones de ouvido giram 90 e ficam bem apoiados confortavelmente em torno do pescoo durante os intervalos de batalhas. Como todo headset HyperX, possui a tecnologia premiada da espuma memory foam. Alm do conforto, a qualidade do som  impecvel! Este modelo possui drivers de 50mm que oferecem qualidade de som impecveis com preciso de udio e garantindo sua imerso no jogo. Ainda para seu conforto possui controles em ao de alta qualidade so projetados para longa durabilidade e estabilidade, se ajustando perfeitamente.\n\nSom imersivo para voc se sentir no jogo com o Headset HyperX\nPossui tambm controle deslizante de volume para sua comodidade. Ele est localizado na parte inferior do fone de ouvido direito. Seu microfone tem cancelamento de rudo que gira para ser silenciado. Tambm com rudo passivo integrado que reduz o rudo de fundo para uma melhor qualidade de voz em seus jogos multiplayer. Um dos seus diferenciais tambm  sua leveza, um headset leve e com toda a tecnologia que voc precisa.\n','Headset Gamer HyperX Cloud Stinger, Drivers 50mm, Mltiplas Plataformas, P2 e P3 - HX-HSCS-BK/NA',7,1),(6,'','R$ 1.089,99','\nProcessador Intel Core i5-10400 \nOs novos processadores Intel Core da 10 Gerao oferecem atualizaes de desempenho incrveis para melhorar a produtividade e proporcionar entretenimento surpreendente, Intel Wi-Fi 6 (Gig) tecnologia, HDR 4K, otimizao de sistema inteligentes e muito mais. \n\nProdutividade acelerada \nRecursos de desempenho inteligente integrados aprendem e se adaptam ao que voc faz, direcionando potncia dinamicamente para onde ela  mais necessria. Os processadores Intel Core da 10 Gerao com memria Intel Optane fornecem a responsividade para fazer mais.\n\nA melhor conectividade da categoria \nCom Intel Wi-Fi 6 (Gig+) e tecnologia Thunderbolt 3 integrados, os processadores Intel Core da 10 Gerao oferecem conectividade cabeada e sem fio rpida, garantida e verstil.\n\nEntretenimento premium \nUma nova arquitetura de grficos oferece suporte a experincias visuais ultravvidas, como vdeo em HDR 4K e jogos a 1080p. Os processadores Intel Core da 10  Gerao com grficos Intel Iris Plus permitem experincias de entretenimento nunca vistas.\n\nJogos srios (serious gaming) \nAproveite jogos incrveis com alto FPS, at mesmo enquanto realiza streaming e gravao. Turbo e acelerao da memria Intel Optane. Em casa ou em qualquer lugar, processadores Intel Core da 10 Gerao capazes de overclocking rodam as plataformas definitivas de jogos em notebooks e desktops.\n\nPossui Vdeo Integrado \n','Processador Intel Core i5-10400, 2.9GHz (4.3GHz Max Turbo), Cache 12MB, LGA 1200 - BX8070110400',6,1),(7,'','R$ 1.089,99','\nProcessador Intel Core i5-10400 \nOs novos processadores Intel Core da 10 Gerao oferecem atualizaes de desempenho incrveis para melhorar a produtividade e proporcionar entretenimento surpreendente, Intel Wi-Fi 6 (Gig) tecnologia, HDR 4K, otimizao de sistema inteligentes e muito mais. \n\nProdutividade acelerada \nRecursos de desempenho inteligente integrados aprendem e se adaptam ao que voc faz, direcionando potncia dinamicamente para onde ela  mais necessria. Os processadores Intel Core da 10 Gerao com memria Intel Optane fornecem a responsividade para fazer mais.\n\nA melhor conectividade da categoria \nCom Intel Wi-Fi 6 (Gig+) e tecnologia Thunderbolt 3 integrados, os processadores Intel Core da 10 Gerao oferecem conectividade cabeada e sem fio rpida, garantida e verstil.\n\nEntretenimento premium \nUma nova arquitetura de grficos oferece suporte a experincias visuais ultravvidas, como vdeo em HDR 4K e jogos a 1080p. Os processadores Intel Core da 10  Gerao com grficos Intel Iris Plus permitem experincias de entretenimento nunca vistas.\n\nJogos srios (serious gaming) \nAproveite jogos incrveis com alto FPS, at mesmo enquanto realiza streaming e gravao. Turbo e acelerao da memria Intel Optane. Em casa ou em qualquer lugar, processadores Intel Core da 10 Gerao capazes de overclocking rodam as plataformas definitivas de jogos em notebooks e desktops.\n\nPossui Vdeo Integrado \n','Processador Intel Core i5-10400, 2.9GHz (4.3GHz Max Turbo), Cache 12MB, LGA 1200 - BX8070110400',6,1),(9,'\\n','R$ 4.499,99','\nPC Gamer Concrdia 32732\n \nEscolhemos um Gabinete Gamer com design bonito e arrojado com frontal com iluminao RGB que certamente trar mais evidncia para o seu setup. O PC Gamer Concrdia vem equipado com um poderoso processador Intel Core i5 de 10 Gerao que oferece atualizaes de desempenho incrveis para melhorar a produtividade, proporcionando entretenimento surpreendente.\n\nCuidadosamente pensado para jogadores de alto nvel, o PC Gamer Concrdia possui uma GTX 1650 de 4GB, que fornece um desempenho  para qualquer tarefa ou jogos mais recentes.\n\nQuando o assunto  velocidade, seu SSD de 480GB certamente dar conta do recado, armazene e acesse  todos os seus arquivos e programas em um piscar de olhos. \n','PC Gamer Concrdia Processador Core i5-10400F, RGB, Geforce GTX1650, 8GB, SSD 480GB, Preto - 32726',1,1),(10,'\\n','R$ 3.362,48','Fcil Computadores - Com 30 anos de excelncia atuando no Brasil, criamos solues completas na rea de informtica. Nossos computadores so equipados com os mais recentes processadores de alta velocidade, maximizando sua produo.\n','Pc Gamer Fcil, Intel Core I7, 16GB, Ssd 480GB, Gtx 1050ti, 4GB - Fonte 500w',1,0),(11,'','R$ 4.299,99','\nPC Gamer Concrdia AMD Ryzen 5 4500\n \nConfigurao Incrvel Focada Em Colecionar Vitrias\nO PC Gamer Concrdia AMD Ryzen 5 4500, possui fonte Concrdia 500w Real, 80 Plus Bronze, automtica com PFC ativo, no  o mximo?! Por ser GeForce GTX 1650, possui uma configurao incrvel, que  extremamente focada em colecionar vitrias, a linha de PC Gamer Concrdia AMD Ryzen,  ideal para quem busca desempenho, velocidade e qualidade de imagem em seus jogos!\nSetup Maravilhoso\nConta com componentes potentes, desde a fonte at o processador, esse sem dvida  o arsenal que voc precisa para conquistar o universo dos games e deixar seu setup maravilhoso! O PC Gamer Concrdia AMD Ryzen garante velocidade e armazenamento, para maior agilidade em tudo o que fizer!\n','PC Gamer Concrdia AMD Ryzen 5 4500, ARGB, GeForce GTX 1650, 16GB RAM, SSD 480GB, Linux, Preto - 33647',1,0),(12,'\\n','R$ 10.999,99','\nPC Gamer Concrdia 32732\n \n\nEscolhemos um Gabinete Gamer com design bonito e arrojado que certamente trar mais evidncia para o seu setup. O PC Gamer Concrdia vem equipado com um poderoso processador Intel Core i7 de 10 Gerao que proporciona at 2,5 vezes mais desempenho.\n\nCuidadosamente pensado para jogadores de alto nvel, o PC Gamer Concrdia possui uma RTX 3060 de 12GB, desempenho alm do limite para qualquer tarefa ou jogos mais recentes.\n\nQuando o assunto  velocidade seu SSD de 500GB com tecnologia NVme certamente d conta do recado, armazene e acesse  todos os seus arquivos e programas em um piscar de olhos. \n\n','PC Gamer Concrdia Core i7-10700F, Geforce RTX3060 12GB, 16GB RAM, SSD 500GB, Branco - 32736',1,0),(13,'\n\\n\n','R$ 2.999,99','\nPC Gamer Skul 3000 I3-10100F, Radeon RX 550, 8GB DDR4, SSD 240GB, 500W PFC ATIVO, Linux \nCom Memria RAM 8GB DDR4 uma configurao focada em colecionar vitrias, a linha de computadores Gamer  ideal para quem busca desempenho, velocidade e qualidade de imagem em seus jogos!\n \nComponentes Potentes\nO PC Gamer Skul 3000 conta com um processador i3 de 10 Gerao. Com componentes potentes, desde a fonte at o processador e a placa de vdeo RX 550 4GB, esse sem dvida  o arsenal que voc precisa para conquistar o universo dos games.\n\nVelocidade e Potncia\nO PC Gamer ainda conta com um SSD 240GB SATA garantindo velocidade e armazenamento, para maior velocidade, o PC ainda conta com Linux. \n\n','PC Gamer Skul 3000 I3-10100F, Radeon RX 550, 8GB DDR4, SSD 240GB, 500W PFC ATIVO, Linux - G4704-120630',1,0),(14,'\\n\n','R$ 10.999,99','\nPC Gamer Acer Predator Orion 5000 Intel Core i7-11700, RGB, NVIDIA GeForce RTX3070, 16GB RAM, SSD 1TB, Windows 11 Home, Preto\n\nProcessador de 11 Gerao\nO novo Desktop Predator Orion chegou para romper barreiras e te levar para um mundo novo dentro do universo gamer. Com processador Intel Core 11 Gen e placa NVIDIA GeForce RTX, jogos, vdeos e softwares rodam leves como uma pena em nveis nunca experimentado antes.\n\nDesbrave os Ambientes Mais Inusitados\nCom placa NVIDIA GeForce 3070 com 8 GB GDDR6 e processador Intel Core i7 Octa Core, o Predator Orion entrega grficos perfeitos, imagens surreais e jogabilidade fluda, que roda seus jogos favoritos com excelente resoluo e riqueza de detalhes, como se fosse uma realidade paralela. O escolhido para viver essa realidade foi voc!\n\nGuarde suas Memrias dessa Batalha Alucinante\nTudo que voc vivenciar com o Orion poder ser guardado com folga. O desktop da Predator conta com 1 TB de armazenamento SSD. Alm disso, voc chegar a novos destinos em alta velocidade, graas  memria RAM de 16 GB.\n\nUm Mundo Novo de Cores s Seu\nA tecnologia ARGB permite brincar com cores e tons, deixando seu setup com a colorao que voc desejar. Misture as cores, use sua imaginao e criatividade e construa seu mundo de cores personalizadas.\n\n','PC Gamer Acer Predator Orion 5000 Intel Core i7-11700, RGB, NVIDIA GeForce RTX3070, 16GB RAM, SSD 1TB, Windows 11 Home, Preto - DG.E2QAL.006',1,0),(15,'\\n\n','R$ 2.299,99','\n\n','PC Gamer Concrdia AMD Ryzen 3-3200G, RGB, 8GB DDR4, SSD 240GB, Linux, Preto - 31723',1,0),(16,'\\n\n','R$ 2.992,88','\nNossos computadores so equipados com os mais recentes processadores de alta velocidade, maximizando sua produo\n\n','PC Gamer Completo Fcil Intel I5 Terceira Gerao, 16GB, GT 420 4GB, SSD 240GB, Monitor 19',1,0),(17,'\\n\n','R$ 2.999,99','\nPC Gamer Fcil AMD Ryzen 5-5600G, RGB, 16GB RAM, SSD 512GB, Linux, Preto - 18343\nFcil Computadores - Com 30 anos de excelncia atuando no Brasil, criamos solues completas na rea de informtica. Nossos computadores so equipados com os mais recentes processadores de alta velocidade, maximizando sua produo.\n\nCOMPUTADOR MONTADO E CONFIGURADO\n\nGabinete Gamer Black com Lateral Transparente. Mais estilo e durabilidade, para seu Setup Gamer nunca te deixar para trs nas batalhas!\nPainel RGB na parte Frontal do Gabinete. Boto seletor com 13 modos de cor RGB!\n\n','PC Gamer Fcil AMD Ryzen 5-5600G, RGB, 16GB RAM, SSD 512GB, Linux, Preto - 18343',1,0),(18,'\\n\n','R$ 5.999,99','\nPC Gamer On Gaming Powered By Asus i5 10400F, RTX 3050 8GB, 16GB, SSD M.2 480GB, ONG104D0516M52, Linux\n\nCom componentes dos Melhores Fabricantes de Ti do Brasil. Alto Desempenho, Performance, Durabilidade e Sutileza Esttica.\n\nExcelente Setup para voc que quer ter acesso a grficos mais exigentes. Com o processador i5 10400F de dcima gerao da Intel, com a placa de vdeo dedicada RTX 3050 8GB, e 16GB de memria Ram, voc ter acesso a jogos com grficos mais elaborados, atingindo excelente fluidez em jogos e projetos.\n\n','PC Gamer On Gaming Powered By Asus i5 10400F, RTX 3050 8GB, 16GB, SSD M.2 480GB, ONG104D0516M52, Linux - ONG104D0516M52',1,0),(19,'\\n\n','R$ 8.999,99','\nPC Gamer Concrdia Intel Core i7-10700F, Memria 16GB, SSD 500 NVME, Placa de Vdeo RTX 3060 12GB Ghost\n \nProcessamento Ultraveloz\nO Computador Concrdia Avalanche Preto, vem equipado com processador Intel Core i7-10700F com 8 Ncleos e 16 Threads e Frequncia de 4.80hz no modo Turbo, Placa Me Asus H510m-e, 16GB de Memoria Corsair Vengeance LPX 8Gb 2666MHz DDR4, com esses hardwares voc ir ter potncia no seu gameplay e tambm nas suas tarefas do dia-a-dia, atualizaes de desempenho incrveis para melhorar a produtividade, proporcionando entretenimento surpreendente.\n\nVelocidade e Potncia\nO Computador Gamer da Concrdia conta com SSD de 500GB NVME, garantindo velocidade e armazenamento, ainda conta com a Placa de Vdeo RTX 3060 12GB Ghost que ir garantir melhor desempenho em jogos como League of Legends, Valorant, Fortnite, Rainbow Six e CS:GO e os jogos mais recentes.\n\nEstabilidade e Confiabilidade\nO Computador  equipado com uma Fonte de alimentao de 600W reais com 80 Plus Bronze e PFC Ativo, que traz energia estvel para no ter nenhum problema enquanto joga. \n\n','PC Gamer Concrdia i7-10700F, Geforce RTX 3060 12GB, 16GB RAM, SSD 500, Avalanche Preto - 33292',1,0);
INSERT INTO `itens` VALUES (20,'\\n\n','R$ 3.268,32','\nPC Gamer Fcil Intel Core I5 10400f 10a Gerao, 16GB DDR4, NVIDIA GEFORCE GT 420 4GB, SSD 480GB, Fonte 500W\n\n','PC Gamer Fcil Intel Core I5 10400f 10a Gerao, 16GB DDR4, NVIDIA GEFORCE GT 420 4GB, SSD 480GB, Fonte 500W',1,0),(21,'\\n\n','R$ 1.091,55','\nSmartphone Motorola Moto G20, 128GB, 4G, Octa-Core, 4GB RAM, Cmera Qudrupla, Verde + Capa Protetora \n\nD vida a jogos, filmes e videochamadas com a tela Max Vision HD+ de 6,5 polegadas. E com uma taxa de 90 Hz no Smartphone Moto G20, o lag d lugar a uma visualizao mais fluida e um desempenho muito mais suave\n\nQuad Cmera com Sensor de 48 MP + Night Vision\n\nCom o sistema Quad Cmera com sensor de 48 MP do smartphone moto G20, voc tira fotos ntidas e vibrantes com pouca luz ou at  noite, alm de retratos lindos com fundo desfocado e imagens bem de perto com um nvel de detalhes surpreendente.\n\nSuperbateria com Mais de Dois Dias de Durao\n\nO smartphone moto G20 possui bateria de 5000 mAh, o que proporciona mais de dois dias de durao a cada recarga. Com ela, voc pode ouvir msicas por 122 horas, assistir a vdeos por 11,6 horas ou navegar na internet por 18,3 horas. Tudo isso com uma nica carga.\n\n','Smartphone Motorola Moto G20, 128GB, 4G, Octa-Core, 4GB RAM, Cmera Qudrupla, Verde + Capa Protetora - PANG0055BR',3,0),(22,'\\n\n','R$ 1.649,00','\nSmartphone Motorola Moto G71, 5G, 6GB RAM, 128GB, Cmera Tripla 50MP, Octa Core, Tela 6.4, Verde \n \nDesempenho Mais Rpido Smartphone Potente\nPrepare-se para a prxima gerao de tecnologia 5G com o moto g71 5G. O processador Snapdragon 695 e os 6 GB de RAM tm a velocidade que voc precisa para se conectar ao 5G.\n\nCarregamento Surreal com a Bateria de 5000Mah\nCom o carregamento TurboPower 30, a bateria carrega rpido. So 5000 mAh para voc fazer tudo que quiser por 30 horas. \n\nCores Vibrantes Na Tela OLED Full HD+ de 6,4\"\nAssista as suas sries e filmes favoritos na tela brilhante que eles merecem. A tela Max Vision de 6,4 tem a tecnologia OLED para produzir imagens cristalinas e pretos mais escuros com brilho e contraste impressionantes.\n\nSistema de cmera tripla com sensor de 50 MP\nDeixe seus cliques mais ntidos com pouca luz, tire fotos ultra-wide com grande-angular, faa retratos com aparncia profissional e capture detalhes bem de perto. Voc tem a cmera ideal para todos os momentos.\n','Smartphone Motorola Moto G71, 5G, 6GB RAM, 128GB, Cmera Tripla 50MP, Octa Core, Tela 6.4, Verde - PAS20017BR',3,0),(23,'\\n\n','R$ 809,00','\nSamsung Galaxy A03\n \nConhea o novo Galaxy Galaxy A03 da Samsung! Com 64GB de memria,  ideal para as tarefas do dia a dia.\n\nPossui uma execelente bateria de 5000mAh, permitindo que voc gaste seu tempo com o que mais gosta e se preocupe menos com a vida til da bateria.\n \nAlcance uma tima qualidade de imagem com as Cmeras duplas do Galaxy A03. Filme, fotografe, e registre os principais momentos da sua vida.\n','Smartphone Samsung Galaxy A03, 4GB RAM, Octa Core, Cmera Dupla 48MP, Tela Infinita 6.5, Preto - SM-A035MZKSZTO',3,0),(24,'\\n\n','R$ 999,00','\nSmartphone Motorola Moto G20\n \nQuad Cmera com Sensor de 48 MP + Night Vision\n \nCom o sistema Quad Cmera com sensor de 48 MP do smartphone moto g20, voc tira fotos ntidas e vibrantes com pouca luz ou at  noite, alm de retratos lindos com fundo desfocado e imagens bem de perto com um nvel de detalhes surpreendente. \n\nTela Max Vision de 6,5\"\" e 90 Hz\n\nD vida a jogos, filmes e vdeo chamadas com a tela Max Vision HD+ de 6,5\"\". E com uma taxa de 90 Hz no smartphone moto G20, o lag d lugar a uma visualizao mais fluida e um desempenho muito mais suave.\n\nSuperbateria com mais de dois dias de durao\n\nO smartphone moto g20 possui bateria de 5000 mAh, o que proporciona mais de dois dias de durao a cada recarga. Com ela, voc pode ouvir msicas por 122 horas, assistir a vdeos por 11,6 horas ou navegar na internet por 18,3 horas. Tudo isso com uma nica carga.\n\n','Smartphone Motorola G20, 64GB, Octa-Core, Cmera Quadrupla, 48MP, Capa Protetora, Grafite - XT212',3,0),(25,'\\n\n','R$ 939,00','\nSmartphone Motorola Moto E40, 64GB, 4GB RAM, Octa Core, Cmera 48MP, Grafite \n \nTire fotos mais claras e ntidas, retratos com efeito profissional e imagens com um nvel de detalhes surpreendente.  a cmera perfeita para todos os ngulos e momentos, at quando a luz no ajuda.\n\nDesempenho 38% Mais Rpido - 64 GB e 4GB de RAM\n \nO processador octa-core customizado turbina os grficos em 38%.  velocidade de sobra para jogar, assistir a vdeos ou registrar a noitada com os amigos. E com 4 GB de RAM da ltima gerao, nunca foi to simples fazer tudo ao mesmo tempo.\n\nMais de 40 Horas de Bateria\n\nCom a bateria reforada de 5000 mAh, voc passa muito mais tempo longe da tomada a cada recarga. Oua msica por 76 horas. Assista a vdeos por 14 horas. Ou navegue na internet por 10 horas. Pode esquecer o carregador. O moto e40 no deixa voc na mo.\n\n','Smartphone Motorola Moto E40, 64GB, 4GB RAM, Octa Core, Cmera 48MP, Grafite - PARJ0014BR',3,0),(26,'\\n\n','R$ 2.906,05','\nSmartphone Motorola Moto Edge 20 Pro, 256GB, 5G, 12GB RAM, Octa Core, 108MP, Tela 6.7, Capa Protetora, Azul \n\nABUSE DE IMAGENS FENOMENAIS COM 108 MP\n\nCapture imagens extremamente ntidas em pouca luz usando a cmera de alta resoluo de 108 MP com a tecnologia Ultra Pixel. Grave vdeos em 8K, a maior resoluo possvel em um smartphone. No perca o foco em longas distncias com o Super Zoom de 50x. \n\nDESCUBRA A TELA OLED COM 144 Hz\n\nVeja mais de um bilho de tonalidades vibrantes na incrvel tela OLED e assista a sries e filmes do seu servio de streaming favorito na telona que eles merecem. Graas  taxa de atualizao extremamente rpida de 144 Hz, o lag d lugar a uma visualizao super fluida. \n\nCONECTIVIDADE MULTITELAS DA PLATAFORMA READY FOR\n\nSeu smartphone tem potncia de sobra. Por isso, criamos o Ready For, que amplifica tudo que h de melhor no seu telefone.  s conectar, com ou sem fio, e pronto. Veja seus jogos de celular na telona para curtir muito mais a experincia.\n\n','Smartphone Motorola Moto Edge 20 Pro, 256GB, 5G, 12GB RAM, Octa Core, 108MP, Tela 6.7, Capa Protetora, Azul - XT2153-1',3,0),(27,'\\n\n','R$ 1.099,00','\nSmartphone Motorola  Moto G31, 128GB, 4GB RAM, Octa Core, Cmera Tripla 50MP, Tela 6.4, Azul \n \nCores Surreais\n\nImagens mais ntidas e vibrantes em uma tela OLED Full HD+ de 6.4 polegadas.\nCom a resoluo Full HD+, os vdeos e fotos no ficam pixelados, e voc v todos os detalhes com muito mais nitidez.\n\nCmera tripla com sensor de 50 MP\n\nGrandes momentos nos mnimos detalhes. Possui tecnologia night vision que permite resultados incrveis incrveis mesmo no escuro. \n\nVoc ir notar a grande diferena que o modo proporciona aos seus cliques noturnos. Surpreenda-se com fotos nitidas, otima claridade e cores vibrantes.\nAgora,  s se divertir com esse sistema de cmeras incrvel.\n\nBateria de Longa Durao\n \nO Motorola Moto G31 conta com uma bateria de 5000MAh, ou seja muito mais tempo pra ficar conectado e ligado em tudo. \nPara a Motorola um bom celular  aquele que voc precisa carregar apenas  noite, aps um dia inteiro de uso e que garanta performance necessria para voc realizar todas as suas tarefas, por isso o Moto G31  ideal, com 5000MAh voc tem bateria o dia todo.\n\n','Smartphone Motorola Moto G31, 128GB, 4GB RAM, Octa Core, Cmera Tripla 50MP, Tela 6.4, Azul - PASK0036BR',3,0),(28,'\n\\n\n','R$ 1.099,00','\nSmartphone Samsung Galaxy M13 128GB Azul\n \nBateria que dura o dia todo\nCom bateria de 5.000 MAh, o Samsung Galaxy M13  um smartphone Android completo sem nada a invejar nos dispositivos mais avanados. Com uma boa memria interna de 128GB com possibilidade de expanso de at 1TB. Seu acabamento na cor azul d mais estilo ao seu novo smartphone.\n \ntimas fotos com seu Galaxy M13\nGraas  cmera de 50 megapixels, o Galaxy M13 tira timas fotos em 8165x6124 pixels e em alta resoluo (Full HD) para gravar vdeo com uma resoluo de 1920x1080 pixels. Muito fino, possui uma espessura de 8,4 mm que torna o Galaxy M13 uma boa escolha para seu prximo smartphone.\n\nTela Infinita com reconhecimento facial\nSurpreendentemente,o M13 possui tela sensvel ao toque de 6,6 polegadas. Para desbloquear o seu Smartphone captura atravs da cmera, o seu rosto em profundidade por meio de mais de 30.000 pontos invisveis para obter o mapa facial 3D preciso e distinto. Desta forma, qualquer tipo de movimento do seu rosto no impedir o dispositivo de detect-lo antes de desbloque-lo.\n\nProcessador octa-core\nO processador  a pea do smartphone que garante a velocidade em tudo que voc fizer nele. O Smartphone Samsung Galaxy M13 possui um processador octa-core de at 2 GHz e memria RAM de 4 GB. Entre os recursos, o Galaxy M13 tem conectividade LTE, Wi-Fi 5, Bluetooth 5.0, NFC, bandeja dupla para chip SIM, entrada para fones de ouvido P2 e porta USB-C. O celular usa a interface One UI Core 4.1 baseada no Android 12.\n\n','Smartphone Samsung Galaxy M13, 4GB RAM, 128GB, Octa Core, Cmera Tripla 50MP, Tela Infinita 6.6, Azul - SM-M135MLBSZTO',3,0),(29,'\n\\n\n','R$ 1.994,05','\nSmartphone Motorola Moto Edge 20, 128GB, 5G, 8GB RAM, 108MP, Tela 6.7, Capa Protetora, Preto\n \nO Primeiro 5G com Design Ultrafino do Brasil\nCom uma estrutura nica em liga de alumnio, o motorola edge 20  ultraleve, mas super-resistente. Ele cabe fcil no bolso ou na bolsa. Com apenas 6,99 mm,  um dos aparelhos mais finos no mercado e o smartphone 5G mais fino que j produzimos.\n\nCmera de 108MP e Super Zoom de 30X\nPrepare-se para qualquer momento, seja de longe ou bem de perto. Registre imagens mais ntidas em situaes de pouca luz com uma cmera principal avanada de 108 MP e tecnologia Ultra Pixel. Grave vdeos com definio incrvel em 4K. No perca o foco em longas distncias com o Super Zoom de 30x.\n\nTela OLED com 144 Hz \nVeja mais de um bilho de tonalidades vibrantes na tela Max Vision de 6,7\" com HDR10+ e tecnologia OLED, que produz imagens cristalinas e pretos mais escuros. Graas  taxa de atualizao extremamente rpida de 144 Hz, o lag d lugar a uma visualizao superfluida para que voc assista a sries e filmes do seu servio de streaming favorito na telona que eles merecem.\n\n','Smartphone Motorola Moto Edge 20, 128GB, 5G, 8GB RAM, 108MP, Tela 6.7, Capa Protetora, Preto - XT2143-1',3,0),(30,'\n\\n\n','R$ 1.199,00','\nSmartphone Samsung Galaxy A22\n \nTela incrvel, rolagem realmente suave\n \nExpanda sua viso para o Infinity-U Display de 6,4 polegadas no Galaxy A22 e veja o que voc est perdendo. Graas  tela HD+ Super AMOLED e 600 nits para maior clareza, seu contedo dirio fica mais ntido e surpreendente. Alm disso, sua taxa de atualizao de 90Hz permite contedos mais suaves e realistas. O design elegante do Galaxy A22 confere um aspecto moderno e atraente. As curvas refinadas o tornam confortvel de segurar e oferecem fcil navegao. \n\nEscolha como fotografar com a cmera qudrupla\n \nTransforme sua galeria em um tesouro de fotos criativas tiradas por voc. A cmera qudrupla do Galaxy A22 eleva sua fotografia a um outro patamar, graas s quatro cmeras que capturam momentos incrveis de quatro maneiras diferentes. Diga adeus s fotos e vdeos embaados. Com a Cmera Principal de 48MP com OIS (Estabilizao tica de Imagem), voc grava vdeos suaves, e captura mais luz para fotos ntidas mesmo em ambientes escuros. Semelhante  viso humana, a Cmera Ultra Wide de 8MP v o mundo por um ngulo de viso de 123 graus, adicionando mais perspectiva a tudo o que voc fotografa. Aproxime-se coma Cmera Macro de 2MP e capture detalhes vvidos. O efeito natural bokeh destaca o objeto fotografado de fundo. A Cmera de Profundidade de 2MP permite ajustar a profundidade de campo em suas fotos. Ajuste o desfoque do fundo para retratos de alta qualidade que destacam o objeto principal.\n\nBateria, Memria e Design Absurda\n\nAproveite o seu dia com uma bateria que no te deixa na mo. A bateria de 5.000 mAh permite que voc mantenha suas atividades por muitas horas. E com at 15W de carregamento rpido, o Galaxy A22 volta rapidamente  carga total. O A22 combina potncia de processamento Octa-core com at 4 GB de memria RAM para um desempenho rpido e eficiente. Desfrute de 128GB de armazenamento interno e expansvel at 1TB a mais com carto MicroSD\n\nConcentre-se mais com o One UI Core\n\nO One UI Core ajuda voc a se concentrar no que importa. O hardware e o software trabalham juntos, com contedo e recursos na ponta dos dedos para que voc possa acess-los mais rapidamente. Troque aplicativos sem interrupes e veja vrios contedos de uma s vez com o design conveniente que permite executar vrias tarefas em uma nica tela.\n\nSeu Samsung Galaxy voc encontra aqui no KaBuM!\n\nO One UI Core ajuda voc a se concentrar no que importa. O hardware e o software trabalham juntos, com contedo e recursos na ponta dos dedos para que voc possa acess-los mais rapidamente. Troque aplicativos sem interrupes e veja vrios contedos de uma s vez com o design conveniente que permite executar vrias tarefas em uma nica tela.\n\n','Smartphone Samsung Galaxy A22, 128GB, 4GB RAM, Octa-Core, Camra Quadrupla + Selfie 13MP, Tela Infinita 6.4, 5000mAh, Preto - SM-A225MZKRZTO',3,0);
INSERT INTO `itens` VALUES (31,'\n\\n\n','R$ 1.124,10','\n\nSmartphone Motorola Moto G22, 4GB RAM, 128GB, Octa Core, Cmera Quadrupla 50mp, Tela Max Vision 6.5, Preto \n\nVeja sua viso ganhar vida com o moto G22  \nCom o sistema Quad Cmera com sensor de 50 MP do smartphone moto g2, tire fotos ntidas e vibrantes com pouca luz ou at  noite, alm de lindos retratos com fundo desfocado e imagens bem de perto com um nvel de detalhes surpreendente.\n\nSistema de cmera qudrupla de 50 MP\nCapture imagens mais ntidas com pouca luz, ultra grande angular fotos, retratos com aparncia profissional e close-ups incrivelmente detalhados.\n\nVida til da bateria inacreditvel \nV mais longe com uma bateria de 5000 mAh de longa durao e deixe as preocupaes de energia para trs.\n\nVisor Max Vision de 6,5\" 90 Hz\nD vida a jogos, filmes e videochamadas com a tela Max Vision HD+ de 6,5\". E com uma taxa de 90 Hz no smartphone moto g22, o lag d lugar a uma visualizao mais fluida e um desempenho muito mais suave.\n\n','Smartphone Motorola Moto G22, 4GB RAM, 128GB, Octa Core, Cmera Quadrupla 50mp, Tela Max Vision 6.5, Preto - PATU0004BR',3,0),(32,'\n\\n\n','R$ 3.499,99','\n\nNotebook Acer Aspire 5 Intel Core i5-10210U, GeForce MX 250, 8GB RAM, 512GB SSD NVMe, 15.6 IPS FHD, Windows 11 Home, Prata - A515-54G-52FY\n\nOs notebooks da linha Aspire 5 so convenientemente portteis e elegantes para acompanhar suas tarefas do dia a dia. Os recursos tecnolgicos de sua confiana ao seu lado sempre que precisar. Desempenho suficiente para todas as tarefas, com Processador Intel Core 10 gerao. Voc cria, edita, compartilha e assiste vdeos, fotos e imagens sem dificuldades.\n\nPodutividade  a Palavra-Chave!\nCom 8 GB de memria Ram, voc no perde tempo, nem fluxo ao editar suas fotos, vdeos e projetos pesados. Com toda essa memria, seus jogos tambm ficam mais fludos e realistas! Viva o significado de agilidade!\n\nA potncia da 10 Gerao\n\nOs novos processadores Intel Core da 10 Gerao oferecem atualizao de desempenho incrveis para melhorar a produtividade e proporcionar entretenimento surpreendente, incluindo at 4.20Ghz, otimizao de sistema inteligente e muito mais.\n\n','Notebook Acer Aspire 5 Intel Core i5-10210U, GeForce MX 250, 8GB RAM, 512GB SSD NVMe, 15.6 IPS FHD, Windows 11 Home, Prata - A515-54G-52FY',2,0),(33,'\n\\n\n','R$ 5.449,00','\n\nNotebook Gamer Acer Nitro 5 AN517-52-77KZ, Intel Core I7, 8GB, 512GB SSD, GTX 1650, 17.3\", Windows 11 Home.\n\n','Notebook Gamer Acer Nitro 5, Intel Core I7, 8GB, 512GB SSD, GTX 1650, 17.3\", Windows 11 Home - AN517-52-77KZ',2,0),(34,'\n\\n\n','R$ 13.499,99','\n\nNo importa se voc est jogando por lazer ou em uma disputa acirrada: graas  jogabilidade mais fluida, voc nunca perde nenhum detalhe essencial. Resultado de cuidadosas decises de engenharia, o mais recente m15, com tela de 165 Hz,  incrivelmente rpido\n\nD descanso aos seus olhos: A tela do m15 R6 inclui nossa tecnologia ComfortView Plus de baixa emisso de luz azul. Esta  uma abordagem baseada em hardware para filtrar a luz azul sem prejudicar a qualidade da imagem, projetada para proporcionar a voc confiana para jogar por horas. O Alienware m15 R6 foi projetado para oferecer variedade. Sejam quais forem suas necessidades nos jogos, este notebook foi pensado no s para atender s suas necessidades, mas para super-las, pois eleva o padro das tecnologias de tela.\n\nA rapidez  indiscutvel: O mais recente m15 R6 vem com uma taxa de atualizao incrivelmente alta, de 165 Hz, e resoluo FHD (1.920 x 1.080) para gerar todas as vezes imagens brilhantes e experincias gamers inesquecveis. Nossa taxa de atualizao mais alta: Disponvel na resoluo FHD, tem a taxa de atualizao perfeita para uma jogabilidade competitiva, em que seus reflexos podem acompanhar a ao de alta velocidade graas a recursos grficos excelentes a opo decisiva para a vitria decisiva.\n\nPara ns, o design  mais do que simples mecnica:  arte. A tecnologia de refrigerao Cryo-Tech da Alienware  uma abordagem de engenharia que no compromete o desempenho dos jogos por meio de mtodos eltricos e mecnicos. Pelo contrrio, ela mantm a estabilidade do sistema at mesmo durante os momentos mais intensos do jogo. O que h melhor em fluxo de ar: Nosso novo chassi m15 R6 prioriza o desempenho com um design de dual fan que extrai o ar frio das ventoinhas inferiores e superiores e faz a exausto pela traseira, pela direita e pela esquerda, proporcionando a refrigerao ideal dos principais componentes. \n\n','Notebook Gamer Dell Alienware m15 R6 Intel Core i7-11800H, GeForce RTX 3070, 16GB RAM, SSD 1TB, 15.6 FHD 165Hz, Win 11, Preto - AW15-i1100-A30P',2,0),(35,'\n\\n\n','R$ 4.699,99','\nNotebook Gamer Ideapad Gaming 3i Intel Core i7-10750H, GTX 1650, 8GB RAM, 512GB SSD, Tela 15.6 FHD WVA, Linux, Chameleon Blue\n\nLenovo ideapad Gaming 3i\nNovo design com 10 Gerao de Processadores Intel Core i7-10750H e placa de vdeo NVIDIA GeForce GTX 1650 4GB. Ideal para gamers e usurios que tambm precisam de alta performance.\n\nTela Full HD\nCom tela de 15.6\'\' Full HD WVA Antirreflexo para melhor definio de imagem e cores. O armanezamento SSD PCIe NVMe  10x mais rpido* que um HDD 2.5 SATA, voc ter mais segurana ao armazenar seus dados. \n\nTeclado retroiluminado\nO teclado retroiluminado em LED azul, deixa o computador mais atraente e tambm favorece a performance para jogos em lugares com pouca iluminao.\n\nResfriamento\n\nSilencioso e no esquenta: projetado com um sistema de resfriamento otimizado composto por 2 coolers e 4 sadas de ar para suportar o alto desempenho do notebook.\n\nWebcam com Privacidade\nSua privacidade pessoal  muito importante.  por isso que o Ideapad Gaming 3i est equipado com prtica porta de privacidade da webcam. Quando no estiver em uma chamada de vdeo ou gravando algo, basta desliz-la. \n\nBateria Longa\nCom at 9.6 horas de durao de bateria o Ideapad Gaming 3i permite que voc jogue por muito mais tempo. Alm de possuir a tecnologia de carregamento rpido: quinze minutos de carregamento garante at duas horas de uso**. \n\nAltamente resistente\nA Lenovo coloca o Ideapad Gaming 3i  prova em testes de resistncia altamente estressantes como: altas e baixas temperaturas, choque de temperatura, quebra e vibrao, certificando a preocupao com a segurana e qualidade. Por meio de testes militares, mantm a convico da melhor escolha sempre. \n\nRapidez e Agilidade\nA distncia entre a tecla e o boto ficou menor: apenas 1.5mm. Tenha mais agilidade, rapidez e tempo de resposta. A funo Q Control permite que o usurio da Lenovo mude a engrenagem simplesmente pressionando as teclas Fn + Q.\n\nPerformance para FPS\nMude do Modo Performance para maior FPS, altere do Modo Silencioso para melhor durao da bateria, ou use o Modo Balanceado para uso dirio. Armazenamento hbrido: Possui 2 slots SSD M.2 e 1 slot HDD SATA.\n\n','Notebook Gamer Lenovo 3i Intel Core i7-10750H, GeForce GTX 1650, 8GB RAM, SSD 512GB, Tela 15.6 Full HD WVA, Linux, Chameleon Blue - 82CGS00200',2,0),(36,'\n\\n\n','R$ 3.999,99','\n\nNotebook Gamer Lenovo Gaming 3i Intel Core i5-10300H\n \nO Notebook Gamer com melhor performance\nNotebook Gamer Lenovo Gaming 3i novo design com 10 Gerao de Processadores Intel Core i5-10300H e placa de vdeo NVIDIA GeForce GTX 1650 4GB, ideal para gamers e usurios que tambm precisam de alta performance Com tela de 15.6\'\' Full HD WVA Antirreflexo para melhor definio de imagem e cores. O armazenamento SSD PCIe NVMe  10x mais rpido que um HDD 2.5 SATA, voc ter mais segurana ao armazenar seus dados. \n\nDesign eficiente para melhor desempenho\nO teclado retroiluminado em LED azul, deixa o computador mais atraente e tambm favorece a performance para jogos em lugares com pouca iluminao. Silencioso e no esquenta: projetado com um sistema de resfriamento otimizado composto por 2 coolers e 4 sadas de ar para suportar o alto desempenho do notebook. Sua privacidade pessoal  muito importante.  por isso que o Ideapad Gaming 3i est equipado com prtica porta de privacidade da webcam. Quando no estiver em uma chamada de vdeo ou gravando algo, basta desliz-la. \n\nIdeapad bateria que dura e te permite jogar mais\nCom at 9.6 horas de durao de bateria o Ideapad Gaming 3i permite que voc jogue por muito mais tempo. Alm de possuir a tecnologia de carregamento rpido: quinze minutos de carregamento garante at duas horas de uso. A Lenovo coloca o Ideapad Gaming 3i  prova em testes de resistncia altamente estressantes como: altas e baixas temperaturas, choque trmico, quebra e vibrao, certificando a preocupao com a segurana e qualidade. Atravs de testes militares, mantm a convico da melhor escolha sempre. \n\n','Notebook Gamer Lenovo IdeaPad Gaming 3i Intel Core i5-10300H, GeForce GTX 1650, 8GB RAM, SSD 256GB, Tela 15.6 FHD, Linux, Azul - 82CGS00100',2,0),(37,'\\n\n','R$ 3.799,99','\nNotebook Acer Aspire 5 Intel Core i7-10510U, 8GB RAM, 512GB SSD NVMe, Tela 15.6 IPS Full HD, Windows 11 Home, Prata - A515-54-74F9\n\nOs notebooks da linha Aspire 5 so convenientemente portteis e elegantes para acompanhar suas tarefas do dia a dia. Os recursos tecnolgicos de sua confiana ao seu lado sempre que precisar. Desempenho suficiente para todas as tarefas, com Processador Intel Core 10 gerao. Voc cria, edita, compartilha e assiste vdeos, fotos e imagens sem dificuldades.\n\nPodutividade  a Palavra-Chave!\nCom 8 GB de memria Ram, voc no perde tempo, nem fluxo ao editar suas fotos, vdeos e projetos pesados. Com toda essa memria, seus jogos tambm ficam mais fludos e realistas! Viva o significado de agilidade!\n\nA potncia da 10 Gerao\n\nOs novos processadores Intel Core da 10 Gerao oferecem atualizao de desempenho incrveis para melhorar a produtividade e proporcionar entretenimento surpreendente, incluindo at 4.90Ghz, otimizao de sistema inteligente e muito mais.\n\n','Notebook Acer Aspire 5 Intel Core i7-10510U, 8GB RAM, 512GB SSD NVMe, Tela 15.6 IPS Full HD, Windows 11 Home, Prata - A515-54-74F9',2,0),(38,'\\n\n','R$ 5.999,99','\n\nNotebook Gamer Acer Nitro 5 AMD Ryzen 7-4800H\n \nAtualize Seus Conceitos De Potncia Brutal\nUm trem expresso direto para o centro da ao est chegando. O notebook gamer Acer Aspire Nitro 5  a nova gerao, com uma configurao que no treme para os jogos mais pesados. Embarque agora e prepare-se para a potncia mxima.\n\nMergulhe de Cabea na Ao\nA super placa de vdeo NVIDIA GeForce GTX 1650 com 4 GB de memria dedicada GDDR6 traz a performance que voc precisa para surpreender seus adversrios e jogar com alto nvel de realismo.\n\nProcessamento que Impe Respeito\nSe  poder que voc quer para chegar mais rpido ao level avanado, conte com o desempenho do Processador AMD Ryzen 7 4800H, alm dos 16 GB de memria tipo DDR4, expansvel at 32 GB.\n\nEspao de Sobra e Muito Veloz\nO Acer Aspire Nitro 5 vem equipado com 256 GB SSD M.2 NVMe + 1 TB HDD, o que promove alta velocidade de leitura e gravao. Com seu sistema operacional e jogos instalados nele, tudo abrir em poucos segundos!\n\nO Seu Campo de Viso Ficou Mais Ntido\nA tela de 15,6 IPS Full HD transforma a sua experincia e te faz mergulhar de verdade na ao. O recurso IPS permite que voc enxergue bem o jogo at dos ngulos mais complicados.\n\n','Notebook Gamer Acer Nitro 5 AMD Ryzen 7-4800H, GeForce GTX 1650, 16GB RAM, SSD 256GB NVMe, HDD 1TB, 15.6 FHD 144Hz, Linux - AN515-44-R4C8',2,0),(39,'\\n\n','R$ 3.799,99','\n\nNotebook Samsung Intel Core i5-1135G7, 8GB RAM, SSD 256GB, 15.6 Full HD, Windows 11 Pro, Cinza\n \nO Samsung Book possui uma arquitetura de ltima gerao e design elegante para quem busca qualidade, desempenho e proteo do investimento. Conta com portas de acesso  memria e unidade de armazenamento, facilitando o upgrade e proporcionando mais longevidade ao sistema. A familia Samsung Books traz uma variedade de configuraes, atendendo aos mais diversos perfis de utilizao, seja para estudo, trabalho ou uso geral.\n\n','Notebook Samsung Intel Core i5-1135G7, 8GB RAM, SSD 256GB, 15.6 Full HD, Windows 11 Pro, Cinza - NP550XDA-KH6BR',2,0),(40,'\\n\n','R$ 5.399,99','\nNotebook Gamer Acer Nitro 5 Intel Core i7-10750H, GeForce GTX 1650, 8GB RAM, 512GB SSD, 15.6 IPS FHD, Win 11 Home, Preto - AN515-55-79X0\n \nAtualize seus conceitos de Potncia Brutal\n\nUm trem expresso direto para o centro da ao est chegando. O notebook gamer Acer Aspire Nitro 5  a nova gerao, com uma configurao que no treme para os jogos mais pesados. Embarque agora e prepare-se para a potncia mxima.\n\nSistema Operacional Windows 11\n\nO Windows 11 conta com ferramentas de fcil utilizao que lhe permitem otimizar o espao de trabalho e maximizar a produtividade. \n\nDesfrute dos jogos mais recentes com grficos incrivelmente realistas. Jogue com amigos no console. Jogue com os seu acessrios favoritos. No que toca ao jogar  sua maneira, pode contar com o Windows 11\n\nNVIDIA GeForce GTX 1650 com 4 GB de memria dedicada GDDR6\n\nA GeForce GTX 1650 foi desenvolvida com o desempenho grfico inovador da premiada arquitetura NVIDIA Turing. Ela  a potncia definitiva para os games atuais mais populares e oferece ainda mais velocidade para os ttulos modernos. Jogue melhor com a GeForce GTX\n\n','Notebook Gamer Acer Nitro 5 Intel Core i7-10750H, GeForce GTX 1650, 8GB RAM, SSD 512GB, 15.6 Full HD IPS 144Hz, Win11 - AN515-55-79X0',2,0),(41,'\\n\n','R$ 1.849,99','\nNotebook Lenovo Ultrafino IdeaPad 3i \n \nLenovo IdeaPad 3i possui design leve e compacto. Com  tela antirreflexo de 15.6\" para mais conforto visual,  o Notebook ideal para todos os momentos.\n\nConta com WiFi AC ultrarrpido e teclado numrico para trabalhar com mais agilidade nas suas planilhas.\n\nO armanezamento SSD PCIe  10x mais rpido* que um HDD 2.5 SATA, voc ter mais segurana ao armazenar seus dados. Nitidez e alta qualidade de som com certificao Dolby Audio.\n\nSua privacidade pessoal  muito importante.  por isso que o IdeaPad 3i est equipado com porta de privacidade da webcam.\n\nQuando no estiver em uma chamada de vdeo ou gravando algo, basta desliz-la. Faa vdeo-conferncias em alta-definio com a cmera HD-720p.\n\nCom base na velocidade de leitura dos dados obtidos atravs de spec de dados de leitura mb/s. \n\n','Notebook Lenovo IdeaPad 3i Intel Celeron N4020 Dual Core, 4GB, SSD 128GB, Windows 11, 15.6, Prata - 82BU0006BR',2,0),(42,'\\n\n','R$ 1.899,99','\nNotebook Acer Aspire 3 Intel Celeron N4020, 4GB RAM, SSD 128GB NVMe, Tela 15,6\', Intel UHD Graphic 600, Windows 11 Home, Preto\n \nDando Conta em Grande Estilo \nDesenvolvido para no deixar voc parar, o Aspire 3 tem a tecnologia que acompanha seu estilo de vida. Equipado com o processador Intel Celeron N4020 Serie N, estudar, trabalhar e se divertir ficam mais fceis.\n\nAgora com Windows 11\nO Aspire 3 vem equipado com o sistema operacional Windows 11 que entrega um visual mais moderno e intuitivo, alm de oferecer os mais diversos benefcios ao seu notebook.\n\nEspao e Velocidade \nCom SSD 128 GB, voc pode ler e gravar arquivos muito mais rpido do que em um HD tradicional. Aps poucos segundos da inicializao do sistema operacional, voc j tem acesso completo s funcionalidades do seu notebook.\n\nImagens Impressionantes\nAssistir vdeos, filmes e sries ser como estar no cinema com a tela de 15.6 HD (1366 x 768). A tecnologia Acer ComfyView otimiza o conforto, refletindo menos luz e garantindo uma visualizao mais confortvel.\n\nBateria que No te Deixa na Mo\nO Aspire 3 foi feito para aguentar todas as necessidades do dia. Dependendo do uso, sua bateria pode durar at 9 horas*, permitindo que voc complete todas as suas tarefas!\n\nSinta o Poder da Conexo\nA tecnologia Wireless 802.11a/b/g/n/ac permite uma conexo bem mais rpida que as tecnologias sem fio tradicionais. Com entrada HDMI 2.0, portas USB 2.0, USB 3.2 e Ethernet (RJ-45), voc tem diversas opes para estar sempre conectado recebendo e distribuindo informao.\n\n\n','Notebook Acer Aspire 3 Intel Celeron N4020, 4GB RAM, SSD 128GB NVMe, Tela 15,6, Intel UHD Graphic 600, Windows 11 Home, Preto - A315-34-C9WH',2,0),(43,'\\n\n','R$ 4.549,99','\nConsole Sony Playstation 5 + Horizon Forbidden West\n \nConsole Playstation5\nO console PS5 oferece novas possibilidades de jogabilidade que voc nunca imaginou.\nReproduza jogos para PS5 e PS4 em Blu-ray Disc. Alm disso, voc tambm pode baixar jogos digitais para PS5 e PS4 pela PlayStation Store.\nExperimente o carregamento extremamente rpido do SSD de ultra-velocidade, uma imerso mais profunda com suporte  resposta ttil, gatilhos adaptveis e udio 3D. Alm de uma gerao totalmente nova de jogos incrveis PlayStation.\nNa velocidade da luz: Domine o poder das CPU e GPU personalizadas e do SSD com E/S integradas que redefinem as regras do que o console PlayStation pode fazer.\nJogos deslumbrantes: Maravilhe-se com os grficos incrveis e experimente os recursos do novo PS5.\nImerso de tirar o flego: Descubra uma experincia de jogos ainda mais profunda com a ajuda da resposta ttil, dos gatilhos adaptveis e da tecnologia de udio 3D.\n\nHorizon Forbidden West\nExplore terras distantes, enfrente mquinas maiores e mais imponentes, e encontre novas tribos incrveis ao retornar para o futuro distante e ps-apocalptico de Horizon.\n\nA terra est morrendo! Tempestades implacveis e uma praga incontrolvel devastam o que sobrou da humanidade enquanto mquinas assustadoras vagam por territrios prximos. A vida na Terra segue rumo  outra extino, e ningum sabe o porqu.\n\nCabe a Aloy descobrir os segredos por trs dessas ameaas e restaurar a ordem e equilbrio ao mundo. Ao longo do caminho, ela reencontrar velhos amigos, forjar alianas com novas faces e descobrir o legado do passado antigo enquanto tenta se manter um passo  frente de um novo inimigo.\n\n','Console Sony Playstation 5 + Horizon Forbidden West',4,0),(44,'\\n\n','R$ 449,90','\nSinta o feedback fisicamente responsivo s suas aes no jogo com atuadores duplos que substituem os motores tradicionais. Em suas mos, essas vibraes dinmicas podem simular a sensao de tudo, desde ambientes at o recuo de diferentes armas. Experimente vrios nveis de fora e tenso conforme voc interage com o equipamento e os ambientes do jogo. Desde puxar a corda do arco cada vez mais tensa at pisar no freio em um carro em alta velocidade, sinta-se fisicamente conectado s suas aes na tela. Converse com amigos online usando o microfone embutido - ou conectando um fone de ouvido ao conector de 3,5 mm. Ligue e desligue facilmente a captura de voz a qualquer momento com o boto dedicado para silenciar. Capture e transmita seus momentos de jogo mais picos com o boto criar. Com base no sucesso do boto pioneiro SHARE, criar oferece aos jogadores mais maneiras de produzir contedo de jogos e transmitir suas aventuras ao vivo para o mundo.\n\n','Controle Sem fio PS5 DualSense',4,0),(45,'\\n\n','R$ 2.095,20','\nO Console Xbox Srie S 512GB SSD  menor e mais elegante de todos os tempos. Com taxas de quadros mais altas, tempos de carregamento mais rpidos e mundos mais ricos e dinmicos, o Xbox Series S da Microsoft oferece desempenho e velocidade de ltima gerao em um formato compacto e totalmente digital. Retrocompatibilidade com milhares de jogos. Prepare-se para tempos de carregamento mais rpidos, resoluo mais alta, taxas de quadros mais estveis e melhor latncia de entrada em milhares de jogos Xbox One, Xbox 360 e Xbox Original.\n\n','Console Xbox, Serie S, SSD 512GB, Branco, Bivolt - RRS-00006.',4,0),(46,'\\n\n','R$ 449,99','\nExperimente o design moderno do Controle Sem Fio Pulse Red, com superfcies esculpidas e geometria refinada para melhorar o conforto durante os jogos com uma durao da bateria de at 40 horas Mantenha-se focado com um direcional hbrido e aderncia texturizada nos gatilhos, botes e tampa do compartimento de pilhas. Capture e compartilhe contedo de forma simplificada, como capturas de tela, gravaes e muito mais com o novo boto de Compartilhamento. Conecte-se usando a entrada USB-C para conectar e jogar diretamente no console ou PC. O suporte para as pilhas AA est includo no tampa do compartimento de pilhas. Use o aplicativo Acessrios do Xbox para remapear botes 