USB, Branco\n \nSNES no seu PC\nPara os fs de jogos clssicos dos anos 90, como Super Mrio World, Donkey Kong Country, entre outros jogos, a Vinik desenvolveu o controle SNES, que possui entrada USB prpria para jogos no PC.\n\nBotes + Cabo\nCom design e acabamento semelhante ao controle tradicional o controle SNES tem botes de comando A, B / X, Y  SELECT e START, alm dos direcionais em formato de cruz e os botes L e R. O controle tambm possui cabo de 1.8M com entrada USB.\n\nPlug and Play\nPara facilitar o uso, o controle possui a tecnologia Plug and Play (Conecte e Jogue), que dispensa a necessidade de instalao de softwares.  s conectar e jogar!\n','Controle SNES para PC Vinik, USB, Branco - 107482',4,0),(52,'\\n\n','R$ 389,99','\nVdeo Game Retro com 8514 jogos a melhor seleo do mercado, 27 plataformas/consoles mais conhecidos, basta ligar na tv e jogar Salve o jogo de onde parou e continue quando quiser. Enviamos para todo o Brasil.\n\n','Video Game Retro Playstation, Com 8500 Jogos + 2 Controles',4,0),(53,'\\n','R$ 782,90','\nDESCRIO Console Atari Flashback X, para matar a saudade de quem nunca se esqueceu do clssico dos anos 80. Entre neste mundo e divirta-se com seus jogos preferidos O console Atari Flashback X possui recursos modernos e impressionantes! Ele tem sada de vdeo de 720p de alta definio com filtro de linha de varredura, um sistema de menu intuitivo, funcionalidade de salvar e retornar o jogo e a capacidade de retroceder um jogo em andamento para se recuperar de um erro cometido. Dois joysticks com fio de aparncia autntica esto includos, permitindo ao de 1 ou 2 jogadores. Este novo design de mini console incrvel tem sistema de computador de vdeo Atari 2600 original. Possui 110 jogos de vdeo game integrados. Esses jogos incluem sucessos como Adventure, Astereoids, Centipede, Chopper Command, Frogger, Missile Command, Pitfall!, Space Invaders, Yars Revenge e muito mais!\n','Video Game Atari Flashback X 110 Jogos',4,0);
